import React from "react";
import { Route, Routes, Link } from "react-router-dom";
import Home from "./Home";
import About from "./About";

const AppRoutes = () => {
    return (
        <div>
            <Routes>
                <Route path="./">{<Home />}</Route>
                <Route path="./about">{<About />}</Route>
            </Routes>
        </div>
    );
};

export default AppRoutes;
